// client/src/pages/AdminDashboardPage.jsx
import React, { useEffect, useState } from 'react';

export default function AdminDashboardPage() {
  const [users, setUsers] = useState([]);
  const [trades, setTrades] = useState([]);

  // We'll fetch data from /api/admin
  useEffect(() => {
    fetchUsers();
    fetchTrades();
  }, []);

  async function fetchUsers() {
    try {
      const token = localStorage.getItem('token');
      const res = await fetch('http://localhost:3001/api/admin/users', {
        headers: {
          Authorization: token,
        },
      });
      const data = await res.json();
      setUsers(data);
    } catch (err) {
      console.error(err);
    }
  }

  async function fetchTrades() {
    try {
      const token = localStorage.getItem('token');
      const res = await fetch('http://localhost:3001/api/admin/trades', {
        headers: {
          Authorization: token,
        },
      });
      const data = await res.json();
      setTrades(data);
    } catch (err) {
      console.error(err);
    }
  }

  return (
    <div className="container mt-5">
      <h1 className="mb-4 text-primary">Admin Dashboard</h1>

      {/* Example Summary Cards */}
      <div className="row mb-4">
        <div className="col-md-3">
          <div className="card">
            <div className="card-body text-center">
              <h5 className="card-title">Total Users</h5>
              <p className="card-text display-6">{users.length}</p>
            </div>
          </div>
        </div>
        <div className="col-md-3">
          <div className="card">
            <div className="card-body text-center">
              <h5 className="card-title">Total Trades</h5>
              <p className="card-text display-6">{trades.length}</p>
            </div>
          </div>
        </div>
        {/* Add more summary cards as needed */}
      </div>

      {/* Users Table */}
      <section className="mb-5">
        <h2 className="mb-3 text-primary">All Users</h2>
        <div className="table-responsive">
          <table className="table table-striped">
            <thead>
              <tr>
                <th>Email</th>
                <th>Role</th>
                {/* Optionally add more columns (e.g., subscription status) */}
              </tr>
            </thead>
            <tbody>
              {users.map((u) => (
                <tr key={u.id}>
                  <td>{u.email}</td>
                  <td>{u.role}</td>
                </tr>
              ))}
            </tbody>
          </table>
        </div>
      </section>

      {/* Trades Table */}
      <section>
        <h2 className="mb-3 text-primary">All Trades</h2>
        <div className="table-responsive">
          <table className="table table-hover">
            <thead>
              <tr>
                <th>Ticker</th>
                <th>Date</th>
                <th>Entry Price</th>
                <th>Exit Price</th>
                <th>Quantity</th>
              </tr>
            </thead>
            <tbody>
              {trades.map((t) => (
                <tr key={t.id}>
                  <td>{t.ticker}</td>
                  <td>{t.tradeDate}</td>
                  <td>${t.entryPrice}</td>
                  <td>${t.exitPrice}</td>
                  <td>{t.quantity}</td>
                </tr>
              ))}
            </tbody>
          </table>
        </div>
      </section>
    </div>
  );
}
